import React from 'react'

function Resulte(props) {
const gg = props.types.map((a)=><li>{a.nom}</li>)

  return (
    <div>
        <h1>Result</h1>
        <div>
            <ul>
              {gg}
            </ul>
        </div>
    </div>
  )
}

export default Resulte
